</style><div class='custom-box'>Este año has pasado <strong>697.6</strong> horas escuchando música.<br>Eso son <strong>41855</strong> minutos, o <strong>29.07</strong> días.</div>
:::



A lo largo del año, has escuchado música del siguiente modo:



::: {.cell layout-align="center"}
::: {.cell-output-display}
![](Resumen_Spotify_files/figure-html/hist-minutos-dia-1.png){fig-align='center' width=672}
