:::



### Música por meses



::: {.cell layout-align="center"}
::: {.cell-output-display}

```{=html}
<div class='custom-box'>De media, cada mes has escuchado <strong>697.58</strong> horas de música.<br>Eso son <strong>41855</strong> minutos, o <strong>29.07</strong> días cada mes.</div>
```

:::
:::



